/* eslint-disable jsx-a11y/anchor-is-valid */
export default function NavBar() {
  return (
    <div
      className="ui"
      style={{ paddingTop: "20px", boxShadow: "0 2px 4px 0 rgba(0,0,0,.2)" }}
    >
      <img src="./images/logo/airbnb.svg" width="100px" alt="logo" />
    </div>
  );
}
